Debbie - Franks never sells them and only gives them away when he sees fit
and to whom he wants.  Congrats April!!!!  

Frank.. keep on Franken-boxen out!!!  

k



  _____  

From: EVP-ITC@yahoogroups.com [mailto:EVP-ITC@yahoogroups.com] On Behalf Of
Fransen, Debbie
Sent: Monday, May 19, 2008 2:16 PM
To: EVP-ITC@yahoogroups.com
Subject: RE: [EVP-ITC] Frank&#39;s Box # 37



I thought that Frank wasn&#39;t giving or selling any boxes.



  _____  

From: EVP-ITC@yahoogroups.com [mailto:EVP-ITC@yahoogroups.com] On Behalf Of
April Slaughter
Sent: Monday, May 19, 2008 3:13 PM
To: EVP-ITC@yahoogroups.com
Subject: [EVP-ITC] Frank&#39;s Box # 37

Frank&#39;s Box # 37 along with two sound chambers arrived today. Thank
you Frank. You put so much time and effort into these devices, not to
mention &#39;heart&#39;. You have a big one, and it is appreciated greatly.

April




